contract MDAI is ERC20, Ownable {
    using SafeMath for uint256;

	mapping(address => bool) public gotToken;

    constructor(
    ) ERC20("mDAI", "mDAI") {
    }

	function mint(uint256 _amount, address _to) external onlyOwner {
		require(_amount > 0, "Amount too low");
		_mint(_to, _amount);
	}

	function getToken() external {
		require(!gotToken[msg.sender], "Already got token");
		_mint(msg.sender, 5000000000000000000000);
		gotToken[msg.sender] = true;
	}
}

